import React from 'react';

const AuthorPage = () => {
  return (
    <div className="author-page">
      <h1>Об авторе</h1>

      <div className="author-info">
        <h2>Тихонова Виктория Андреевна</h2>

        <div className="project-info">
          <p>
            Данный проект разработан в качестве дипломной работы на курсе 
            <strong> "Институт Интеллектуальной Робототехники"</strong>, 
            направление <strong>"Мехатроника и Робототехника"</strong>.
          </p>
        </div>

        <div className="acknowledgments">
          <h3>Благодарности</h3>
          <p>
            Выражаем благодарность <strong>Василию Постных</strong> 
            за предоставленные данные для разработки проекта.
          </p>
        </div>
      </div>
    </div>
  );
};

export default AuthorPage;
